$fh.ready({}, function() {
  FormView = $fh.forms.backbone.FormView.extend({
    initialize: function(params) {
      var self = this;
      params = params || {};
      params.fromRemote = false;
      params.rawMode = true;
      self.options = params;
      $fh.forms.backbone.FormView.prototype.initialize.call(this, params);

      if (params.form) {
        params.formId = params.form.getFormId();
      }

      this.loadForm(params, function() {
        self.trigger("loaded");
        if (params.autoShow) {
          self.$el.show();
        }
        self.render();
      });
    },
    saveToDraft: function() {
      var self = this;
      AlertView.showAlert("Saving Draft", "info", 1000);
      $fh.forms.backbone.FormView.prototype.saveToDraft.apply(this, [
        function(err) {
          if(err){
            AlertView.showAlert("Error Saving Draft.", "error", 1000);
          } else {
            refreshSubmissionCollections();
            self.submission.on("validationerror", self.onValidateError);
            AlertView.showAlert("Draft Saved", "success", 1000);
          }
        }
      ]);
    },
    submit: function submit() {

      const params = {
        "formId": "56bd4affc7a6046f4f77f627",
        "fromRemote": true
      };

      $fh.forms.getForm(params, function (err, form) {
        if (err) {
          console.error(err);
        }

        const photoFieldParams = {
          "fieldId": "5747db5233447bdb4ceb6c87",
          "value": "data:image/png;base64,",
          "index": 0,
          "isStore": true
        };

        const observer = {
          "fieldId": '5614e237f7a712af2bd5aa02',
          "value": 'Mr. Observer'
        };

        const location = {
          fieldId: '56371d79a183bcd159085db6',
          'value': 'Waterford'
        };

        const date = {
          fieldId: "5614e237f7a712af2bd5aa04",
          'value': "2018-01-26"
        };

        const state = {
          fieldId: "5614e237f7a712af2bd5aa06",
          'value': "QLD"
        };

        const project = {
          fieldId: "5614e237f7a712af2bd5aa07",
          'value': "WIDEBAND"
        };

        const company = {
          "fieldId": "5614e237f7a712af2bd5aa09",
          "value": 'Red Hat'
        };

        const worker = {
          "fieldId": "5614e237f7a712af2bd5aa0a",
          "value": 'Gerard Ryan'
        };

        const announced = {
          "fieldId": "5614e237f7a712af2bd5aa08",
          "value": 'Unannounced'
        };

        const observationType = {
          "fieldId": "57b27e258a6d5527185a4e64",
          "value": {selections: ["Zero Harm Observation"]}
        };

        const category = {
          "fieldId": "561717c6176460c020685afc",
          "value": {selections: ["Environmental distrubance"]}
        };

        const observed = {
          "fieldId": "5638277caf68f39d7cefdc18",
          "value": "It's 'disturbance', not 'distrubance'"
        };

        const discussed = {
          "fieldId": "56c4fcb8c7a6046f4f77f739",
          "value": "The weather"
        };

        const agreement = {
          "fieldId": "56c4fcb8c7a6046f4f77f73a",
          "value": "Fix the field name"
        };

        const behaviour = {
          "fieldId": "57a2d2656c332d2a18c36f4f",
          "value": "Generally Sound"
        };

        const attachPic = {
          "fieldId": "5747db5233447bdb4ceb6c86",
          "value": "Yes"
        };

        const actions = {
          "fieldId": "56c4fcb8c7a6046f4f77f73b",
          "value": {selections: ["No Action Required"]}
        };

        async function submitRecursively() {
          const submission = form.newSubmission();

          const addInputValueProm = Promise.promisify(submission.addInputValue, { context: submission });

          await addInputValueProm(observer);
          await addInputValueProm(location);
          await addInputValueProm(date);
          await addInputValueProm(state);
          await addInputValueProm(project);
          await addInputValueProm(company);
          await addInputValueProm(worker);
          await addInputValueProm(announced);
          await addInputValueProm(observationType);
          await addInputValueProm(category);
          await addInputValueProm(observed);
          await addInputValueProm(discussed);
          await addInputValueProm(agreement);
          await addInputValueProm(behaviour);
          await addInputValueProm(attachPic);
          await addInputValueProm(photoFieldParams);
          await addInputValueProm(actions);

          /* Only uncomment this if you want to debug, otherwise it'll
           * cause the console to hold onto lots of these large
           * objects
           */
          // console.log(submission);

          await Promise.promisify(submission.submit, {context: submission})();
          await Promise.promisify(submission.upload, {context: submission})();

          while (submission.getStatus() === 'inprogress') {
            console.log(`In progress: ${submission.getStatus()}`);
            await new Promise(resolve => setTimeout(resolve, 100));
          }
          console.log(`Complete: ${submission.getStatus()}`);

          return submitRecursively();
        };
        return submitRecursively();
      });
    }
  });
});
